import React, { useEffect, useState } from "react";
import axios from "axios";
import BuySellButton from "./BuySellButton.jsx";
// function DataFetching()
// {

// }
const ExchangeRankTable = (props) => {

  const [click,setClick]=useState(false);


  const [text,setText]=useState("");

  function buy(){
    setClick(true);
    setText("Buy")
  }

  function sell(){
    setClick(true);
    setText("Sell")
  }

  const [tb, setTb] = useState([]);
  useEffect(() => {
    axios
      .get(`./record${props.id}.json`)
      .then((res) => {
        console.log(res);
        setTb(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [props.id]);
  return (
    <div className="ExchangeRankTable">
      <table>
        <tr>
          <th>Exchange</th>
          <th>Price</th>
          <th>Buy/Sell</th>
        </tr>

        {tb.map((data) => (
          <tr key={data.id}>
            <td>{data.exc}</td>
            <td>{data.price}</td>
            <td>
                     {/* <BuySellButton /> */}
                <button className="BuyButton" variant="contained" size="small" color="primary" onClick={()=>setClick(true)}> Buy</button>
                <button className="SellButton" variant="contained" size="small" style={{marginLeft:"1rem"}}  onClick={()=>setClick(true)} >Sell</button>
            </td>
            <td>
                {}
            </td>
          </tr>
        ))}
      </table>
    </div>
  );
};
export default ExchangeRankTable;
